import React from 'react';
import {Box, CloseButton, Divider, HStack, Spacer, Text} from "@chakra-ui/react";
import {AiOutlineUsergroupAdd} from "react-icons/all";

function MdOutlinePublic() {
    return null;
}

const ShareDialog = ({setVisible}) => {
    return (
        <>
            <Box bg={'gray.400'}
                 opacity={.8}
                 position={'fixed'}
                 top={0} minH={'100vh'}
                 right={0}
                 onClick={() => setVisible(false)}
                 minW={'100vw'}
                 zIndex={900}>

            </Box>
            <Box p={5} w={500} bg={'white'}
                 transform={"translate(50%,-50%)"}
                 position={'fixed'} top={'30%'} right={'50%'} height={300} zIndex={901}>
                <HStack>
                    <AiOutlineUsergroupAdd/>
                    <Text>Invite</Text>
                    <Spacer/>
                    <CloseButton size={'md'}/>
                </HStack>
                <Divider/>
                <HStack>
                    <MdOutlinePublic/>
                    
                </HStack>
            </Box>
        </>
    );
};

export default ShareDialog;
